import React from 'react'
import {BrowserRouter, Switch, Route, Link} from 'react-router-dom'

class EventsIndex extends React.Component {
    render(){
        // return <div>
        //     <h1>Events Index</h1>
        //     <ul class="nav nav-tabs">
        //         <li><a href = "#list" data-toggle = "tab">List</a></li>
        //         <li><a href = "#details" data-toggle = "tab">Details</a></li>
        //         <li><a href = "#create" data-toggle = "tab">Create</a></li>
        //         <li><a href = "#edit" data-toggle = "tab">Edit</a></li>
        //         <li><a href = "#delete" data-toggle = "tab">Delete</a></li>
        //     </ul>

        //     <div class = "tab-content">
        //         <div id = "list" class = "tab-pane fade">
        //             {/* <EventList /> */}
        //         </div>

        //         <div id = "details" class = "tab-pane fade">
        //             {/* <EventDetails /> */}
        //         </div>

        //         <div id = "create" class = "tab-pane fade">
        //             {/* <EventCreate /> */}
        //         </div>

        //         <div id = "edit" class = "tab-pane fade">
        //             {/* <EventEdit /> */}
        //         </div>

        //         <div id = "delete" class = "tab-pane fade">
        //             {/* <EventDelete /> */}
        //         </div>
        //     </div>


        // </div>
        return <div>
            <h1>Route Component</h1>
            <BrowserRouter>
                <h2>Browser Route Demo</h2>
                <Link to="/">Home</Link> | 
                <Link to="about">About</Link> | 
                <Link to="help">Help</Link> | 
                <Link to="contact">Contact</Link> |
                <Link to="fruits">Fruits</Link> |
                <Link to="items">Items</Link> |
                <Link to="calc">Calculator</Link> <hr/>
                <Switch>
                    <Route exact path="/" render={() => { return <div> <h1> Index Component</h1></div>}} />
                    <Route path="/help" render={() => { return <div> <h1> Help Component</h1></div>}} />
                    <Route path="/about" render={() => { return <div> <h1> About Component</h1></div>}} />
                    <Route path="/contact" render={() => { return <div> <h1> Contact Component</h1></div>}} />
                    <Route path="/fruits" component={FruitsComponent} />
                    <Route path="/items">
                        <h1>Item Component Division</h1>
                        {/* <ItemsComponents 
                            category='cakes' 
                            items={['Chocolate', 'Vanilla', 'ButterScotch', 'Strawberry', 'Black Forest']} /> */}
                    </Route>
                    <Route patch="/calc">
                        {/* <CalcComponent a="5" b="10"/> */}
                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    }
}

export default EventsIndex
